import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';

function App() {
  return (
    <div className="App">
      {/* <Navbar /> */}
      <p>Hi there, Shubhada here</p>
      <div className="flex justify-between"> {/* Use Flexbox to arrange content */}
        <div className="ml-48 w-72">
          <img src={me} className="me" alt="Image" />
        </div>
        <div className="flex justify-end">
          <ConsoleWindow />
        </div>
      </div>
    </div>
  );
}

export default App;
